import React from "react";
import { ListImage } from "../components/image";

const index = () => {
    return (
        <>
            <h1 class="text-6xl">Slider </h1>
            <div class="flex flex-no-wrap bg-gray-200 overflow-hidden ">
                {ListImage.map(src => (
                    <img class="w-1/2 rounded-lg mx-4" src={src} />
                ))}
            </div>

        </>
    )
}

export default index;
